import React from "react";

import Video from "./Video";

const VideoList = ({ data, onVideoSelected, meta2}) => {
  return (
    <div className="video-list">
      <div style={{ padding: "20px 0" }}>
        <h3>
          Videos List
        </h3>
        <Video 
          data={data} 
          onVideoSelected={onVideoSelected} 
          meta2 = {meta2}
        />
      </div>
    </div>
  );
};

export default VideoList;
